import React from 'react';
import { Link, UnorderedList, ListItem, majorScale } from 'evergreen-ui';
import { headerMenuStyles } from './styles.js';

export const HeaderMenu = () => {
  return (
    <>
      <UnorderedList
        className="header__menu"
        display="flex"
        alignItems="center"
        marginRight={majorScale(2)}
      >
        <ListItem>
          <Link href="https://thesustainablelist.typeform.com/to/PnaHPh">
            <strong>Add a brand</strong>
          </Link>
        </ListItem>
        <ListItem>
          <Link href="/about">About</Link>
        </ListItem>
        <ListItem>
          <Link href="/contact">Contact Us</Link>
        </ListItem>
      </UnorderedList>
      <style jsx>{headerMenuStyles}</style>
    </>
  );
};
